import React, { useState } from "react";
import CartIcon from "../images/CartIcon.png";
import FilterIcon from "../images/FilterIcon.png";
import logo from "../images/logo.png";
import MenuIcon from "../images/MenuIcon.png";
import SearchIcon from "../images/SearchIcon.png";
import UserIcon from "../images/UserIcon.png";
import historialAct from "../images/historialAct.png";
import sistemaVal from "../images/sistemaVal.png";
import reportesPer from "../images/reportesPer.png";
import checkout from "../images/checkout.png";
import soporte from "../images/soporte.png";
import idioma from "../images/idioma.png";
const Headerr = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <div
      style={{
        ...styles.fixedShell,
        boxShadow: scrolled ? "0 4px 16px rgba(0,0,0,0.15)" : "none",
      }}
    >
      <div style={styles.topBar}>
        <img src={logo} alt="Logo" style={styles.logo} />

        <div style={styles.divBar}>
          {/* MENU BUTTON */}
          <div style={{ position: "relative" }}>
            <button
              style={styles.SmallWrapper}
              onClick={() => setMenuOpen((prev) => !prev)}
            >
              <img src={MenuIcon} alt="Menu" style={styles.icon} />
            </button>
          </div>

          <div style={styles.searchWrapper}>
            <button style={styles.iconBtn}>
              <img src={FilterIcon} alt="Filter" style={styles.icon} />
            </button>
            <input
              type="text"
              placeholder="Buscar..."
              style={styles.searchInput}
            />
            <button style={styles.iconBtn}>
              <img src={SearchIcon} alt="Search" style={styles.icon} />
            </button>
          </div>

          <button style={styles.SmallWrapper}>
            <img src={CartIcon} alt="CartIcon" style={styles.icon} />
          </button>
        </div>

        <div style={styles.user}>
          <img src={UserIcon} alt="User" style={styles.iconUser} />
          <span>Bienvenido, Ing. Erick</span>
        </div>
      </div>

      <div style={styles.bottomBar}>
        <nav style={styles.nav} aria-label="Categorías">
          <a href="#" style={styles.navLink}>
            <img src={historialAct} alt="" style={styles.navIcon} />
            Historial
          </a>

          <a href="#" style={styles.navLink}>
            <img src={sistemaVal} alt="" style={styles.navIcon} />
            Sistema de Valoración
          </a>

          <a href="#" style={styles.navLink}>
            <img src={reportesPer} alt="" style={styles.navIcon} />
            Reportes Personales
          </a>

          <a href="#" style={styles.navLink}>
            <img src={checkout} alt="" style={styles.navIcon} />
            Checkout
          </a>

          <a href="#" style={styles.navLink}>
            <img src={soporte} alt="" style={styles.navIcon} />
            Soporte
          </a>

          <a href="#" style={styles.navLink}>
            <img src={idioma} alt="" style={styles.navIcon} />
            Idioma
          </a>
        </nav>
      </div>
    </div>
  );
};

const styles = {
  fixedShell: {
    position: "fixed",
    top: 0,
    left: 0,
    right: 0,
    width: "100%",
    zIndex: 1000,
    backgroundColor: "#5baed6",
    display: "flex",
    flexDirection: "column",
  },
  container: {
    display: "flex",
    flexDirection: "column",
    width: "100%",
  },
  topBar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: "#5baed6",
    padding: "10px 80px",
    height: "100px",
    gap: "50px",
  },
  divBar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: "#5baed6",
    padding: "10px 170px",
    height: "90px",
    width: "1000px",
  },
  logo: {
    height: "100px",
  },
  searchWrapper: {
    display: "flex",
    alignItems: "center",
    flex: 1,
    width: "500px",
    margin: "0 20px",
    backgroundColor: "white",
    borderRadius: "25px",
    border: "1px solid #2b6daf",
    padding: "5px 10px",
  },
  SmallWrapper: {
    backgroundColor: "white",
    border: "1px solid #2b6daf",
    borderRadius: "20px",
    width: "50px",
    height: "40px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    cursor: "pointer",
  },
  searchInput: {
    flex: 1,
    border: "none",
    outline: "none",
    padding: "5px 10px",
    fontSize: "14px",
  },
  iconBtn: {
    background: "none",
    border: "none",
    padding: "0 5px",
    cursor: "pointer",
  },
  icon: {
    height: "20px",
    width: "20px",
  },
  iconUser: {
    height: "30px",
    width: "30px",
  },
  user: {
    display: "flex",
    alignItems: "center",
    gap: "5px",
    color: "white",
    cursor: "pointer",
    height: "20px",
    width: "250px",
  },

  bottomBar: {
    backgroundColor: "#003B90",
    height: "60px",
    display: "flex",
    alignItems: "center",
    padding: "0", // ✅ sin espacios a los lados
    margin: "0", // por si acaso
    width: "100%",
  },

  nav: {
    display: "grid",
    gridTemplateColumns: "repeat(6, 1fr)", // 6 columnas iguales
    width: "100%",
    height: "100%",
  },

  navLink: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    gap: "8px",
    textDecoration: "none",
    color: "white",
    height: "100%",
    width: "100%",
    transition: "background 0.3s, color 0.3s",
  },

  navLinkHover: {
    backgroundColor: "#D8572F",
    color: "white",
  },

  navIcon: {
    width: "40px",
    height: "40px",
    objectFit: "contain",
  },
};

export default Headerr;
